import React from 'react';
import {
    EllipsisOutlined,
    CommentOutlined,
} from '@ant-design/icons';
import PersonIcon from '@material-ui/icons/Person';

const Category = () => {
    return (
        <div>
            <PersonIcon />
            <CommentOutlined />
            <EllipsisOutlined />
            
        </div>
    )
}

export default Category;
